mapper.select:
select 

from NHBZ.DSE_BZ_RUNINFO_REAL
where STCD = #{STCD,jdbcType=VARCHAR}
  and AIRCREWNM = #{AIRCREWNM,jdbcType=VARCHAR}
  and PIPENM = #{PIPENM,jdbcType=VARCHAR}

mapper.delete:
delete from NHBZ.DSE_BZ_RUNINFO_REAL
where STCD = #{STCD,jdbcType=VARCHAR}
  and AIRCREWNM = #{AIRCREWNM,jdbcType=VARCHAR}
  and PIPENM = #{PIPENM,jdbcType=VARCHAR}
